import React, { useState, useEffect } from 'react';
import data_file from "../db/test-assignment";

function Teams() {
  const [data, setData] = useState([]);  

  useEffect(() => {
    setData(data_file);

    console.log(data_file);
  }, []);

  return (
    <ul>
        {data.map(({id, name}) => (
        <li>
            {name}
            <div>
                <button onClick={() => voteHomeTeam(id)}>Complete</button>
                <button onClick={() => voteDraw(id)}>x</button>
                <button onClick={() => voteAwayTeam(id)}>x</button>
            </div>
        </li>
        ))}
    </ul>
  );
}
export default Teams;
